import MoviesArray from "./data"

function MovieList(){
  return(
    <>
    <div>
      <table>
      <tr>
        <th>Movie Name</th>
        <th>Movie Rank 1</th>
        <th>Movie Rank 2</th>
        <th>Genre</th>
        <th>Director</th>
        <th>Actors</th>
        <th>Year</th>
      </tr>
      {MoviesArray.map((movie) => (
        <tr>
          <td key={movie.Title}>
            {movie.Title}
          </td>
          <td key={movie.imdbRating}>
            {movie.imdbRating}
          </td>
          <td key={movie.Ratings[3]}>
            {movie.Ratings[3].Value}
          </td>
        </tr>
      ))}
      </table>
    </div>
    </>
  )
}
export default function App(){
  return(
    <>
    <MovieList />

    </>
  )
}
